import React, { Component } from 'react'

class DailyGoals extends Component {
    render() {
        const {dailyTodos} = this.props.dailyTodos;
        // const displayTodos = this.props.map.dailyTodos(todo => {
        //     return(
        //         <div className="onedailygoal">
        //             <div className="onedailygoalheading">
        //                 <h4>{todo.title} </h4>123
        //             </div>
        //         </div> 
        //     )
        // })

        return (
            <div className="onedailygoal">
                {
                    this.props.dail(todo => {
                        return(
                            <div className="onedailygoal">
                                <div className="onedailygoalheading">
                                    <h4>{todo.title} </h4>123
                                </div>
                            </div> 
                        )
                    })
                }
            </div> 
        )
    }

}
export default DailyGoals
